import React,{Component} from 'react';
import './App.css';
getuser= () => {
  console.log("got");
}
class App extends Component {

  render() {    
    return(<div className="App">
        <h2> List of users</h2>
        <button onClick={getuser}> get user</button>
      </div>)
  };
}

export default App;
